import re

def countTags(code_snippet):
    php_tags = re.findall('', code_snippet, re.IGNORECASE)
    html_elements = re.findall('<\\w+\\b', code_snippet, re.IGNORECASE)
    php_tag_counts = {}
    html_element_counts = {}
    for tag in php_tags:
        tag = tag.lower()
        php_tag_counts[tag] = php_tag_counts.get(tag, 0) + 1
    for element in html_elements:
        element = element[1:].lower()
        html_element_counts[element] = html_element_counts.get(element, 0) + 1
    return {'phpTags': php_tag_counts, 'htmlElements': html_element_counts}

